snippet.textDisplay:
@Adriano Paulino Rebouças O ministério da saúde tá trabalhando tanto que até a Indonésia já se vacinou enquanto aqui falta até sinringa.
É preciso de planejamento pra fecha, mas preciso planejamento pra abrir também, pois estamos falando vivas.
Cadê os 1 trilhões 200 bilhões que Guedes doou para os bancos sem obrigar baixar os juros que os  empresário não conseguem fazer emprestimo?

